import React from 'react'
import styled from 'styled-components'
function floating(){
    const floating_style = styled.div`
        width: 70vh;
        height: 70vh;
        position: absolute;
        border-radius: 50%;
        margin-left: -37vh;
        margint-top: -37vh;
        background: linear-gradient(180deg, black 0%,white 100%)
        filter:blur(100px)
    `;
    return(
        <floating_style></floating_style>
    )
}

export default floating
